import "./App.css";
import image1 from "./image1.JPG";

export default function App() {
  return (
    <div className="App">
      <div className="container">
        <header className="App-header">
          <img src={image1} className="App-logo img-fluid" alt="logo" />
        </header>
      </div>
    </div>
  );
}
